import React, { useState, useEffect } from 'react';
import { useAuth } from '../context/AuthContext';
import { getAuthFromSW, clearAuthFromSW, storeAuthInSW } from '../services/authServiceWorker';

function DebugPage() {
  const { user, isAuthenticated, isDevMode, loading, checkAuthState } = useAuth();
  const [localStorageItems, setLocalStorageItems] = useState({});
  const [serviceWorkerStatus, setServiceWorkerStatus] = useState('Checking...');
  const [swAuthData, setSwAuthData] = useState(null);
  const [lastChecked, setLastChecked] = useState(new Date());

  // Scan localStorage for relevant values
  const scanLocalStorage = () => {
    const items = {};
    const relevantKeys = [
      'devModeUser', 
      'devModeUser_v1', 
      'devModeUser_v2', 
      'devModeUser_bypass',
      'supabase.auth.token',
      'sb-localhost-auth-token'
    ];

    relevantKeys.forEach(key => {
      try {
        const value = localStorage.getItem(key);
        items[key] = value ? (key.includes('token') ? 'TOKEN PRESENT' : JSON.parse(value)) : null;
      } catch (e) {
        items[key] = `ERROR: ${e.message}`;
      }
    });

    setLocalStorageItems(items);
    setLastChecked(new Date());
  };

  // Check service worker status
  const checkServiceWorkerStatus = async () => {
    // Check if service worker is registered
    if ('serviceWorker' in navigator) {
      try {
        const registrations = await navigator.serviceWorker.getRegistrations();
        if (registrations.length > 0) {
          setServiceWorkerStatus(`Active (${registrations.length} registrations)`);

          // Try to get auth data from service worker
          try {
            const authData = await getAuthFromSW();
            setSwAuthData(authData);
          } catch (e) {
            console.error('Error getting auth data from SW:', e);
            setSwAuthData({ error: e.message });
          }
        } else {
          setServiceWorkerStatus('Not registered');
          setSwAuthData(null);
        }
      } catch (error) {
        setServiceWorkerStatus(`Error: ${error.message}`);
        setSwAuthData(null);
      }
    } else {
      setServiceWorkerStatus('Not supported');
      setSwAuthData(null);
    }
  };

  // Run scan on mount and when auth state changes
  useEffect(() => {
    scanLocalStorage();
    checkServiceWorkerStatus();
  }, [isAuthenticated, user]);

  const refreshAuth = async () => {
    await checkAuthState();
    scanLocalStorage();
    checkServiceWorkerStatus();
  };

  const clearAllAuth = async () => {
    try {
      const keysToRemove = [
        'devModeUser', 
        'devModeUser_v1', 
        'devModeUser_v2', 
        'devModeUser_bypass',
        'supabase.auth.token',
        'sb-localhost-auth-token'
      ];

      keysToRemove.forEach(key => {
        try {
          localStorage.removeItem(key);
        } catch (e) {
          console.error(`Error removing ${key}:`, e);
        }
      });

      // Also clear from service worker
      try {
        await clearAuthFromSW();
      } catch (e) {
        console.error('Error clearing auth data from SW:', e);
      }

      alert('Auth storage cleared');

      // Refresh the scan
      scanLocalStorage();
      checkServiceWorkerStatus();

    } catch (error) {
      console.error('Error clearing auth state:', error);
      alert(`Error clearing auth state: ${error.message}`);
    }
  };

  // Create mock user
  const createMockUser = async () => {
    try {
      const mockUser = {
        id: 'debug-user-id',
        email: 'debug@example.com',
        user_metadata: {
          name: 'Debug User',
        },
        created_at: new Date().toISOString()
      };

      // Store in all possible keys
      const storageKeys = ['devModeUser_v2', 'devModeUser_v1', 'devModeUser', 'devModeUser_bypass'];
      storageKeys.forEach(key => {
        try {
          localStorage.setItem(key, JSON.stringify(mockUser));
        } catch (e) {
          console.error(`Failed to set ${key}:`, e);
        }
      });

      // Also store in service worker
      try {
        await storeAuthInSW(mockUser);
      } catch (e) {
        console.error('Error storing auth data in SW:', e);
      }

      alert('Mock user created');

      // Refresh the scan and auth state
      refreshAuth();

    } catch (error) {
      console.error('Error creating mock user:', error);
      alert(`Error creating mock user: ${error.message}`);
    }
  };

  return (
    <div style={{ padding: '20px', maxWidth: '800px', margin: '0 auto' }}>
      <h1>Auth Debug Tool</h1>

      <div style={{ marginBottom: '20px', padding: '15px', backgroundColor: '#f5f5f5', borderRadius: '4px' }}>
        <h2>Current Auth State</h2>
        <div><strong>Is Authenticated:</strong> {String(isAuthenticated)}</div>
        <div><strong>Is Dev Mode:</strong> {String(isDevMode)}</div>
        <div><strong>Is Loading:</strong> {String(loading)}</div>
        <div><strong>User Email:</strong> {user?.email || 'None'}</div>
        <div><strong>User ID:</strong> {user?.id || 'None'}</div>
        <div><strong>Service Worker:</strong> {serviceWorkerStatus}</div>
        <div><strong>Last Checked:</strong> {lastChecked.toLocaleTimeString()}</div>
      </div>

      <div style={{ marginBottom: '20px' }}>
        <h2>Actions</h2>
        <div style={{ display: 'flex', gap: '10px', flexWrap: 'wrap' }}>
          <button 
            onClick={refreshAuth}
            style={{
              padding: '10px',
              backgroundColor: '#4caf50',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            Refresh Auth State
          </button>

          <button 
            onClick={clearAllAuth}
            style={{
              padding: '10px',
              backgroundColor: '#f44336',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            Clear All Auth Storage
          </button>

          <button 
            onClick={createMockUser}
            style={{
              padding: '10px',
              backgroundColor: '#2196f3',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            Create Mock User
          </button>

          <button 
            onClick={() => window.location.reload()}
            style={{
              padding: '10px',
              backgroundColor: '#ff9800',
              color: 'white',
              border: 'none',
              borderRadius: '4px',
              cursor: 'pointer'
            }}
          >
            Reload Page
          </button>
        </div>
      </div>

      <div style={{ marginBottom: '20px' }}>
        <h2>LocalStorage Contents</h2>
        <pre style={{ 
          backgroundColor: '#f5f5f5', 
          padding: '15px', 
          overflow: 'auto',
          maxHeight: '300px',
          borderRadius: '4px'
        }}>
          {JSON.stringify(localStorageItems, null, 2)}
        </pre>
      </div>

      <div>
        <h2>Service Worker Auth Data</h2>
        <pre style={{ 
          backgroundColor: '#f5f5f5', 
          padding: '15px', 
          overflow: 'auto',
          maxHeight: '300px',
          borderRadius: '4px'
        }}>
          {swAuthData ? JSON.stringify(swAuthData, null, 2) : 'No data'}
        </pre>
      </div>
    </div>
  );
}

export default DebugPage;
